generated.css:
@font-face{
  font-family: RobotoCondensed;
  src: url(bcc3453643980c72f35684516709adf4.ttf);
  font-weight: 800;
}

@font-face{
  font-family:EconomicaBold ;
  src: url(f17271936c78ae1ec15f283512a9e27d.ttf);
}

body{
  text-align: center;
  font-size: 20px;
  padding: 2.5%;
}

h1, h2, h3, h4, h5{
  font-family: 'aerial';
}


.profile{
  width: 200px;
  height: 200px;
  border-radius: 100px;
}

button{
  border-radius: 100px;
  font-size: medium;
}

.title-fade-in{
  opacity: 100;
  animation-name: fade-in;
  animation-duration: 2s;
}

.title-fade-out{
  opacity: 0;
  animation-name: fade-out;
  animation-duration: 2s;
}

@keyframes fade-in{
  from{opacity: 0;}
  to{opacity: 100;}
}
@keyframes fade-out{
  from{opacity: 100;}
  to{opacity: 0;}
}
